import React, { useEffect, useState} from 'react';
import Loading from './Loading';
import DropdownButton from "../components/DropdownButton";
const optionsArr = [
  {
    name: "opt1",
    label: "Option 1",
    onClick: () => {}
  },
  {
    name: "opt2",
    label: "Option 2",
    onClick: () => {}
  },
  {
    name: "opt3",
    label: "Option 3",
    onClick: () => {}
  },
  {
    name: "opt4",
    label: "Sub Option 4",
    onClick: () => {},
    subMenu: [
      {
        name: "subOpt4",
        label: "Sub Option 1",
        onClick: () => {}
      }
    ]
  },
  {
    name: "opt5",
    label: "Sub Option 5",
    onClick: () => {},
    subMenu: [
      {
        name: "subOpt5",
        label: "Sub Option 2",
        onClick: () => {}
      }
    ]
  }
];

const MusicPlayer = () => {
  const [isLoading, setIsLoading] = useState(true);
  useEffect(() => {
    setTimeout(() => {
      setIsLoading(false);
    }, 1500);
  })
  if(isLoading){
    return(
      <Loading />
    );
  }
    return (
        <div align='center'>
          <div className="wrapper">
      <DropdownButton buttonText="Dropdown Button" options={optionsArr} />
    </div>
        </div>
    )
}

export default MusicPlayer
